// Get all existing IDs from Google Sheets
const existingIds = $items('Load Existing Job IDs').map(i => i.json.ID);

// Current job
const job = $input.item.json;
const jobId = job.data?.job_id;

// If ID already exists ‚Üí skip this item
if (existingIds.includes(jobId)) {
	return null; // <-- correct way to skip
}

// Otherwise ‚Üí pass it forward
return $input.item;

// Get all incoming items to this node
const allItems = $input.all();
// Count them
const count = allItems.length;

return [{ json: { count } }];

const input = $json.search_query || "";
const query = encodeURIComponent(input);

return [{ json: { query } }];
